import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <footer>
      <img
        src="https://i.imgur.com/F8FF2Zk.png"
        width={40}
        height={60}
        className="logo"
        onClick={() => {
          setModalIsOpen(false); // 모달 1 닫기
          setModalIsOpen2(false); // 모달 2 열기/닫기 토글
        }}
      ></img>
      <div class="inner">
        <div class="footer-message">
          합리적인 분들과 좋은 컨텐츠가 지속될 수 있는 선순환 시스템을
          지향합니다
        </div>
        <div class="footer-contact">컨택: dream@fun-coding.org</div>
        <div class="footer-copyright">Copyrigh 2020 All ⓒ rights reserved</div>
      </div>
    </footer>
  );
};

export default Footer;
